from django.urls import pathfrom .views import (    CreatePrj,    PrjDetail,    add_member,    delete_member,    prj_members)app_name = 'project'urlpatterns = [    path('prj_create/<int:pk>', CreatePrj, name='create_prj'),    path('prj_detail/<int:prj_id>', PrjDetail, name='detail_prj'),    path('<int:prj_id>/add_member/<int:user_pk>/<int:role_id>', add_member, name='project_member'),    path('<int:prj_id>/delete_member/<int:user_pk>', delete_member, name='delete_member'),    path('<int:org_id>/<int:prj_id>/project_member_list/', prj_members, name='prj_member_list'),]